import React from 'react';
import Form from './Form';

const Sixth = (props) => {
    const answers = [""];
    return (
        <div>
            <h1 style={{textAlign: 'center'}}>
                Шпион выйди вон
            </h1>
            <div className="Description">
                Его лучший друг сегодня тусит с нами. Он(а) хочет помочь, но боится быть следующ(ей)им. Замаскируйся новогодним антуражем и узнай ответ у человека с ярким вкусом.
            </div>
            <Form
                answers={answers}
                maxlength="20"
                history={props.history}
                team={props.team}
                changeStep={props.changeStep}
            />
        </div>
    )
}

export default Sixth;
